import React, {Component} from 'react';
import TimerIcon from '@material-ui/icons/Timer';
import './Node.css'

class Node extends Component {

    render() {
        const {
          col,
          isFinish,
          isStart,
          isWall,
          isWeight,
          isStop,
          onMouseDown,
          onMouseEnter,
          onMouseUp,
          row,
        } = this.props;
        const extraClassName = isFinish
          ? 'node-finish'
          : isStart
          ? 'node-start'
          : isWall
          ? 'node-wall'
          : isWeight
          ? 'node-weight'
          : isStop
          ? 'node-stop'
          : ''

        return (
          <div
            id={`node-${row}-${col}`}
            className={`node ${extraClassName}`}
            onMouseDown={() => onMouseDown(row, col)}
            onMouseEnter={() => onMouseEnter(row, col)}
            onMouseUp={() => onMouseUp()}>

          </div>
        );
      }
}

export default Node;
